                    "timezone": "America/Denver",
                    "introBody": "\u003cp class=\"MsoNormal\"\u003e\u003cstrong\u003eWelcome to Premium Leaf\u003c/strong\u003e\u003c/p\u003e \u003cp class=\"MsoNormal\"\u003e\u003cstrong\u003eSame Day Delivery Service \u003c/strong\u003e\u003c/p\u003e \u003cp class=\"MsoNormal\"\u003ePlease \u003cstrong\u003eTEXT\u003c/strong\u003e \u003cstrong\u003e587-664-1162\u003c/strong\u003e  to start the intake/ registration process and to place your order.\u003c/p\u003e \u003cp class=\"MsoNormal\"\u003e \u003c/p\u003e \u003cp class=\"MsoNormal\"\u003eWe try to respond as promptly as possible but on very busy days it may take up to 10-15 minutes for us to respond. We appreciate your understanding as we want to ensure every client is satisfied with their service and we have obtained the appropriate details to carry out your order! \u003c/p\u003e \u003cp class=\"MsoNormal\"\u003e\u003cstrong\u003eNo Delivery fee\u003c/strong\u003e to Calgary , Airdrie, Cochrane, Bragg Creek,Okotoks, Strathmore and Chestermere\u003c/p\u003e \u003cp class=\"MsoNormal\"\u003e\u003cstrong\u003e-  -  -  -  -\u003c/strong\u003e\u003c/p\u003e \u003cp class=\"MsoNormal\"\u003e\u003cstrong\u003eDelivery Ordering Details\u003c/strong\u003e\u003c/p\u003e \u003cp class=\"MsoNormal\"\u003e\u003cstrong\u003e1)\u003c/strong\u003eWe do require a minimum purchase of \u003cstrong\u003e$25\u003c/strong\u003e in Calgary and a minimum \u003cstrong\u003e$40 \u003c/strong\u003eto Cochrane, Airdrie,and Chestermere and \u003cstrong\u003e$65\u003c/strong\u003e to Strathmore, Okotokes, and Bragg Creek- but in the wonderful world of cannabis culture we know that is easily achieved.\u003c/p\u003e \u003cp class=\"MsoNormal\"\u003e\u003cstrong\u003e2)\u003c/strong\u003eWhen placing an order with Premium Leaf please have a valid piece of goverment issued photo ID ready. We require proof of age before orders are placed.  Please attach a copy to your order. Orders Will not be processed if valid ID is not supplied.  \u003c/p\u003e \u003cp class=\"MsoNormal\"\u003e\u003cstrong\u003e3)Late Evening Deliveries-\u003c/strong\u003eCustomer Service lines will be open to you for up 30 minutes after your delivery has been completed. This is for deliverys that shall be completed after the scheduled close time. Please reach out if you have any questions! Order cutoff is noted to be 9:00pm\u003c/p\u003e \u003cp class=\"MsoNormal\"\u003e\u003cstrong\u003e***\u003c/strong\u003ePlease Note; 10 minutes from the time you have been notified of your deliveries arrival if we have no response from you we will move onto the next delivery. At anytime if our drivers feel unsure or uncomfortable- they have the right to refuse to complete the delivery. \u003c/p\u003e \u003cp class=\"MsoNormal\"\u003e\u003cstrong\u003e-  -  -  -  -\u003c/strong\u003e\u003c/p\u003e \u003cp class=\"MsoNormal\"\u003eOrders will only be processed via short message service (SMS)/Text. \u003c/p\u003e \u003cp class=\"MsoNormal\"\u003eOur esimated email response time will be within 24 hours for all other inquires. \u003c/p\u003e \u003cp class=\"MsoNormal\"\u003e\u003cstrong\u003eThank you!\u003c/strong\u003e\u003c/p\u003e \u003cp class=\"MsoNormal\"\u003eThe Premium Leaf Team\u003c/p\u003e",
